define('share_live',['require','jquery','pnotify'],function(require) {
	require("jquery");
	require("pnotify");
    $(function() {
        var share_url_get = function() {
            var share_url_before = "<iframe height=498 width=510 src='";
            var share_url = $(".share-btn").data("url");
            var share_url_after = "' frameboard=0 allowfullscreen></iframe>";
            share_url = share_url_before + share_url + share_url_after;
            return share_url;
        }
        var share_menu = function() {
            var back_div = $('<div class="share_menu" tabindex=2 style="display:none;"><div class="coner">◆</div><div class="coner_border">◆</div></div>');
            back_div.appendTo($(".share-btn").parent());
           	$('<div class="jiathis_style"><a class="jiathis_button_qzone">QQ空间</a><a class="jiathis_button_cqq">QQ好友</a><a class="jiathis_button_tqq">腾讯微博</a><a class="jiathis_button_tsina">新浪微博</a><a class="jiathis_button_weixin">微信</a><a class="jiathis_button_renren">人人网</a></div>').appendTo(back_div);
        	var common_url = $('<div class="common_url"></div>');
        	common_url.appendTo(back_div);
        	$(".share_code").attr({"value":share_url_get()});
			$(".btn-share").attr({
				"data-clipboard-text":share_url_get()
			});	 
			return back_div;
        }
       
  var back_div = share_menu();
        var statu = function() {
        	if(back_div.css("display")=="none")
        		return false;
        	else	
        		return true;
        }
        var show_menu = function() {
        	if(statu()) 
        		back_div.fadeOut();
        	else
        		back_div.fadeIn();
        }
        $(".btn-share").click(function(){
        	copyToClipBoard();
        });
        $(".share-btn").click(function(){
        	show_menu();
		back_div.focus();
        });
        $(".icon-share").click(function(){
        	show_menu();
        });
	$(".share_menu").blur(function(){
		back_div.fadeOut();
	});
    });
});

define("search-history",['require','jquery'],function(require){
	require("jquery");
	var Search_menu = function(json) {
		var back = $('<div class="search_history"></div>').appendTo($(".history-query").parent());
		var back_ul = $('<ul class="back_ul"></ul>').appendTo(back);
		var cnt = 0 ;
		for(i in json) {
			cnt ++ ;
			var li = $('<li>'+json[i]+'</li>').appendTo(back_ul);
		}
		
		var k = parseInt(cnt*Math.random());
		
		$(".history-query").attr({"placeholder":"大家正在热搜："+json[k]});
		return back;
	}
	var event_listener = function(back) {
		$(".history-query").click(function(){
			$(this).parent().attr({
				"tabindex":"1"
			});
			$(this).parent().focus();
			back.css({
				"display":"block"
			});
		});
		$(".back_ul li").on("click",function(){
			$(".history-query").attr({
				"value":$(this).text()
			});
			setTimeout(function(){
				$("#search").submit();
			},300);

		});
		$(".form-group").on("keydown",function(){
			$(".history-query").focus();
		});
		$(".form-group").on("blur",function(){
			back.css({
				"display":"none"
			});
		});
	}
	$(function(){
		$.get("/api/media?hot_search=1",function(json){
			back = Search_menu(json);
			event_listener(back);	
		},"json");
		$(".search_tools").on("click",function(){
			$("#search").submit();	
		});	
	});
});

define('live-detail',['require','store','jquery','bootstrap','jwplayer','headroom','jrumble','jwplayhtml5','share_live','search-history'],function(require) {
    var store=require("store");
    require("jquery");
    require("bootstrap");
    require("jwplayer");
    require("headroom");
	require("jrumble");
    require("jwplayhtml5");
	require("share_live");
	var $slider = $(".banner .carousel");
    require("search-history");
    $(function() {
        var $slider = $(".banner .carousel");
        $slider.find(".active .ad-title, .active .ad-desc").show();
        $player = $("#player");
        jwplayer("player").setup({
			image: $player.data("image"),
			width: 1124,
            		height: 510,
            		autostart:true,
			stretching:"exactfit",
			html5player: "../portal_static/js/jwplayer.html5.js",
            		flashplayer: "../portal_static/js/jwplayer.flash.swf",
			logo: {
				file: "../portal_static/img/water.png",	
			},
			sources:[{
				file: $player.data("live"),label:"live","defalut":"true"
			}]
		});
		$(".btn-lik").bind("click",function(){
			like();
		});
		$(".icon-like").bind("click",function(){
			like();
		});
		$(".btn-dislike").bind("click",function(){
			dislike();	
		});
		$(".icon-dislike").bind("click",function(){
			dislike();
		});
		var hasId = function(id,str) {
			if(!str) {
				return false;
			}

			var arr = str.split(",");
			for(i in arr) {
				if(arr[i]==id) {
					return true;
				}
			}
			return false;
		}
		var id = $("#id").val(); 
		if(hasId(id,store.get('like_live'))) {
			$(".icon-like").addClass("icon-like-select");
			$(".btn-lik").css({
				"cursor":"initial"
			});
			$(".btn-dislike").css({
				"cursor":"initial"
			});
			$(".icon-dislike").addClass("icon-dislike-enable");
			$(".icon-dislike").removeClass("icon-dislike");
		}
		if(hasId(id,store.get('dislike_live'))) {
			$(".icon-dislike").addClass("icon-dislike-select");
			$(".btn-dislike").css({
				"cursor":"initial"
			});
			$(".btn-lik").css({
				"cursor":"initial"
			});
			$(".icon-like").addClass("icon-like-enable");
			$(".icon-like").removeClass("icon-like");
		}
		var like = function() {
			var like_statu = hasId(id,store.get("like_live"));
			var dislike_statu = hasId(id,store.get("dislike_live"));
		
			if(!like_statu&&!dislike_statu) {
				store.set('like_live',store.get('like_live')+","+id);
				$.get("/api/live?likes=1&id="+id,function(){
					$(".links").html(String(parseInt($(".links").text())+1));
					$(".icon-like").addClass("icon-like-select");
					$(".icon-dislike").addClass("icon-dislike-enable");
					$(".icon-dislike").removeClass("icon-dislike");
	
					$(".btn-dislike").css({
						"cursor":"initial"
					});	
				});
			}
		}
		var dislike = function() {
			var like_statu = hasId(id,store.get("like_live"));
			var dislike_statu = hasId(id,store.get("dislike_live"));
		
			if(!like_statu&&!dislike_statu) {
				store.set('dislike_live',store.get('dislike_live')+","+id);
				$.get("/api/live?dislikes=1&id="+id,function(){
					$(".dislikes").html(String(parseInt($(".dislikes").text())+1));
					$(".icon-dislike").addClass("icon-dislike-select");
					$(".icon-like").addClass("icon-like-enable");
					$(".icon-like").removeClass("icon-like");
	
					$(".btn-lik").css({
						"cursor":"initial"
					});
				});
			}
		}
		
    });
});

